import React from "react";

const Welcome = () => {
  return (
    <div className="w-50 d-flex flex-column align-items-center">
      <h2>Welcome to I-Study</h2>
      <p>
        A school online teaching and learning system for teacher and Student
      </p>
    </div>
  );
};

export default Welcome;
